import React from 'react';
import { Row, Col } from 'react-bootstrap';

const MypageModal = () => {

  return (
    <>
      <div className="apply-vacation-wrap">
        <Row>
          <Col md={4}>
            <div>
              왼쪽
            </div>
          </Col>
          <Col md={8}>
            <div>
              오른쪽
            </div>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default MypageModal;
